import React from "react";
import { Container, Navbar } from "react-bootstrap";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";

const NavComponent = () => {
	return (
		<>
			<Router>
				<Navbar
					fixed="top"
					className="shadow dark_mode"
					expand="lg"
				></Navbar>
			</Router>
		</>
	);
};

export default NavComponent;
